  `ext0` varchar(50) DEFAULT NULL COMMENT '备注',
  `cauid` bigint(20) DEFAULT '-1' COMMENT '客户经理id',
  `flag` int(5) DEFAULT '0' COMMENT '0:正常;2:禁用;-1:已删',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

