/*Table structure for table `t_order` */

DROP TABLE IF EXISTS `t_order`;

CREATE TABLE `t_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `uid` bigint(20) DEFAULT '-1',
  `wid` bigint(20) DEFAULT '-1' COMMENT '洗车人',
  `aid` bigint(20) DEFAULT '-1' COMMENT 't_auto',
  `cid` bigint(20) DEFAULT '-1' COMMENT 't_combo',
  `amount` decimal(10,2) DEFAULT '0.00' COMMENT '订单金额',
  `realAmount` decimal(10,2) DEFAULT '0.00' COMMENT '实付',
  `fundUsable` decimal(10,2) DEFAULT '0.00' COMMENT '余额抵扣',
  `tid` int(11) DEFAULT '0' COMMENT 't_order_type',
  `ono` varchar(32) DEFAULT NULL COMMENT '订单号',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `payTime` datetime DEFAULT NULL COMMENT '支付时间',
  `subscribeTime` datetime DEFAULT NULL COMMENT '预约时间',
  `washTime` datetime DEFAULT NULL COMMENT '接单时间',
  `washingTime` datetime DEFAULT NULL COMMENT '开始洗车时间',
  `finishTime` datetime DEFAULT NULL COMMENT '完成时间',
  `pmid` int(11) DEFAULT '0' COMMENT 't_method',
  `extNo` varchar(50) DEFAULT NULL COMMENT '第三方订单号',
  `address` varchar(100) DEFAULT NULL COMMENT '车辆定位地址',
  `lng` decimal(10,6) DEFAULT '0.000000' COMMENT '经度',
  `lat` decimal(10,6) DEFAULT '0.000000' COMMENT '纬度',
  `vTag` bigint(20) DEFAULT '0' COMMENT '优惠券',
  `mTag` bigint(20) DEFAULT '0' COMMENT '月卡',
  `flag` int(5) DEFAULT '0' COMMENT '状态',
  `msg` varchar(100) DEFAULT NULL COMMENT '错误信息',
  `ext` varchar(256) DEFAULT NULL COMMENT '备注',
  `addressDetail` varchar(100) DEFAULT NULL COMMENT '详细地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=325 DEFAULT CHARSET=utf8;

/*Data for the table `t_order` */

