/*Table structure for table `t_person` */

DROP TABLE IF EXISTS `t_person`;

CREATE TABLE `t_person` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `uid` bigint(20) DEFAULT NULL,
  `nickname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '昵称',
  `icon` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '头像',
  `facePic` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '实名面部图像',
  `realName` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `idno` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `IDCard0` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '身份证正面',
  `IDCard1` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '身份证反面',
  `leftCounts` int(11) DEFAULT '3' COMMENT '认证剩余次数',
  `linkman` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '紧急联系人',
  `linkphone` varchar(13) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '紧急联系电话',
  `flag` int(5) DEFAULT '0' COMMENT '1:认证中;2:认证失败;3:认证成功',
  `inService` int(5) DEFAULT '0' COMMENT '接单中',
