/* Function  structure for function  `f_format_bankcard_no` */

/*!50003 DROP FUNCTION IF EXISTS `f_format_bankcard_no` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_format_bankcard_no`(`in_cardno` VARCHAR(20)) RETURNS varchar(25) CHARSET utf8
BEGIN



	DECLARE _str, tmpStr VARCHAR(25) DEFAULT '';

	DECLARE i, times, len, tmpLen INT(5) DEFAULT 0;



	IF in_cardno IS NULL OR LENGTH(in_cardno) < 5 THEN

		RETURN '';

	END IF;



	SET tmpStr = RIGHT(in_cardno,4);

	SET len = LENGTH(in_cardno);

	SET tmpLen = len - 4;



	SET _str = '';

	WHILE i != tmpLen DO

		SET _str = CONCAT(_str,'*');



		SET i = i + 1;

	END WHILE;

	SET _str = CONCAT(_str,tmpStr);



	SET i = 0;

	SET tmpStr = '';

	SET len = FLOOR(len / 4) + 1;

	WHILE i != len DO

		SET tmpStr = CONCAT(tmpStr,SUBSTR(_str FROM 4 * i + 1 FOR 4),' ');



		SET i = i + 1;

	END WHILE;



	RETURN TRIM(tmpStr);

END */$$
DELIMITER ;

/* Function  structure for function  `f_format_cell` */

/*!50003 DROP FUNCTION IF EXISTS `f_format_cell` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_format_cell`(`in_tel` varchar(20)) RETURNS varchar(20) CHARSET utf8
BEGIN



	IF ISNULL(in_tel) OR LENGTH(in_tel) != 11 THEN

		RETURN '*******1234';

	END IF;



	RETURN CONCAT('*******',SUBSTR(in_tel FROM 8 FOR 4));

END */$$
DELIMITER ;

/* Function  structure for function  `f_format_decimal_2` */

/*!50003 DROP FUNCTION IF EXISTS `f_format_decimal_2` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_format_decimal_2`(`in_amount` decimal(18,6)) RETURNS varchar(25) CHARSET utf8
BEGIN



	DECLARE tmpStr VARCHAR(25) DEFAULT NULL;



	IF ISNULL(in_amount) THEN

		RETURN '0.00';

	END IF;



	SET tmpStr = CONCAT('', in_amount);



	RETURN SUBSTR(tmpStr, 1, LENGTH(tmpStr) - 4);

END */$$
DELIMITER ;

/* Function  structure for function  `f_format_idno` */

/*!50003 DROP FUNCTION IF EXISTS `f_format_idno` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_format_idno`(`in_idno` varchar(20)) RETURNS varchar(20) CHARSET utf8
BEGIN



	IF ISNULL(in_idno) OR !(in_idno REGEXP '^[0-9]{17}[0-9Xx]$') THEN

		RETURN '';

	END IF;



	RETURN CONCAT(SUBSTR(in_idno FROM 1 FOR 1),'****************',SUBSTR(in_idno,18));

END */$$
DELIMITER ;

/* Function  structure for function  `f_format_ono` */

/*!50003 DROP FUNCTION IF EXISTS `f_format_ono` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_format_ono`(in_oid BIGINT,`in_amount` bigint,`in_type` int) RETURNS varchar(32) CHARSET utf8
BEGIN



	DECLARE tmpLong, tmpCounts BIGINT DEFAULT 0;

	DECLARE tmpStr, tmpCountsStr, tmpSign VARCHAR(32) DEFAULT NULL;



	SET tmpStr = DATE_FORMAT(CURDATE(),'%Y%m%d');

	SET tmpCountsStr = RIGHT(CONCAT('00000000', in_oid), 8);

	SET tmpLong = (in_amount + in_oid + CONVERT(tmpStr, UNSIGNED)) * in_type;

	SET tmpSign = HEX(tmpLong);

	IF LENGTH(tmpSign) < 7 THEN

		SET tmpSign = RIGHT(CONCAT('0000000', tmpSign), 7);

	END IF;



	RETURN CONVERT(CONCAT(in_type, tmpStr, tmpSign, tmpCountsStr), CHAR);

END */$$
DELIMITER ;

/* Function  structure for function  `f_format_realname` */

/*!50003 DROP FUNCTION IF EXISTS `f_format_realname` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_format_realname`(`in_realname` varchar(50)) RETURNS varchar(10) CHARSET utf8
BEGIN



	DECLARE tmpLen INT(10) DEFAULT 0;



	IF ISNULL(in_realname) OR LENGTH(in_realname)=0 THEN

		RETURN '';

	END IF;

	SET tmpLen = CHAR_LENGTH(in_realname);



	RETURN CONCAT('**',SUBSTR(in_realname FROM tmpLen));

END */$$
DELIMITER ;

/* Function  structure for function  `f_format_referee_code` */

/*!50003 DROP FUNCTION IF EXISTS `f_format_referee_code` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_format_referee_code`(`in_uid` bigint) RETURNS varchar(20) CHARSET utf8
BEGIN



	RETURN CONVERT(in_uid + 10000, CHAR);

END */$$
DELIMITER ;

/* Function  structure for function  `f_format_string` */

/*!50003 DROP FUNCTION IF EXISTS `f_format_string` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_format_string`(`in_string` varchar(255),in_len int(10)) RETURNS varchar(100) CHARSET utf8
BEGIN



	DECLARE tmpLen INT(10) DEFAULT 0;



	IF ISNULL(in_string) THEN

		RETURN '(无)';

	END IF;



	SET tmpLen = CHAR_LENGTH(in_string);

	IF tmpLen <= in_len THEN

		RETURN CONCAT(in_string, '**********');

	END IF;



	RETURN CONCAT(SUBSTR(in_string FROM 1 FOR in_len), '**********');

END */$$
DELIMITER ;

/* Function  structure for function  `f_get_age_by_idno` */

/*!50003 DROP FUNCTION IF EXISTS `f_get_age_by_idno` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_get_age_by_idno`(`in_idno` varchar(20)) RETURNS varchar(5) CHARSET utf8
BEGIN



	IF ISNULL(in_idno) OR LENGTH(in_idno) != 18 THEN

		RETURN '30';

	END IF;



	RETURN CONVERT(YEAR(CURDATE()) - CONVERT(SUBSTR(in_idno FROM 7 FOR 4), SIGNED), CHAR);

END */$$
DELIMITER ;

/* Function  structure for function  `f_get_sex_by_idno` */

/*!50003 DROP FUNCTION IF EXISTS `f_get_sex_by_idno` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `f_get_sex_by_idno`(`in_idno` varchar(20)) RETURNS varchar(3) CHARSET utf8
BEGIN



	IF ISNULL(in_idno) OR LENGTH(in_idno) != 18 THEN

		RETURN '男';

	END IF;



	RETURN IF(CONVERT(SUBSTR(in_idno FROM 17 FOR 1), SIGNED) % 2 = 0, '女', '男');

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_consumer_add` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_consumer_add` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_consumer_add`(IN in_openID VARCHAR(100), IN in_icon VARCHAR(255), IN in_nickname VARCHAR(255),IN in_refereeCode VARCHAR(20), IN in_sign0 VARCHAR(32), IN in_sign1 VARCHAR(32), IN in_oCode INT, IN in_remarks VARCHAR(1024), IN in_ip VARCHAR(25), OUT `out_result` int(10))
_pb:BEGIN



	DECLARE _error INT DEFAULT 0;

	DECLARE tmpUType INT DEFAULT 1;

	DECLARE tmpResult, tmpUid, tmpReferee BIGINT DEFAULT -1;

	DECLARE tmpCurTime datetime DEFAULT NOW();



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	IF LENGTH(in_refereeCode) > 4 THEN

		SET tmpResult = -2;

		SELECT COUNT(*),id INTO tmpResult,tmpReferee FROM t_user WHERE flag>-1 AND refereeCode LIKE in_refereeCode;

		IF tmpResult != 1 THEN

			SET tmpReferee = -1;

		END IF;

	END IF;



	INSERT INTO t_user(userType,referee,openid,createTime,sign0,sign1) VALUE(tmpUType, tmpReferee, in_openID, tmpCurTime, in_sign0, in_sign1);

	SELECT LAST_INSERT_ID() INTO tmpUid;

	IF tmpUid < 1 THEN

		SET out_result = 91;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	UPDATE t_user SET refereeCode=f_format_referee_code(id) WHERE id=tmpUid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_result = 94;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	INSERT INTO t_person(icon,nickname,uid) VALUE(in_icon, in_nickname, tmpUid);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_result = 92;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE(tmpUid, tmpUType, in_oCode, tmpCurTime, in_remarks, in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_result = 93;

		LEAVE _pb;

	END IF;



	IF _error <> 0 THEN

		SET out_result = 90;

		LEAVE _pb;

	ELSE

		SET out_result = -tmpUid;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_fund_record_sum_consumer` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_fund_record_sum_consumer` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_fund_record_sum_consumer`(IN `in_uid` bigint,IN in_uType INT(5),IN in_pageSize INT(5),OUT `out_result` int(10),OUT out_fund VARCHAR(100))
_pb:BEGIN



	DECLARE _error INT DEFAULT 0;



	DECLARE tmpFundSumIn, tmpFundSumOut, tmpFundUsable DECIMAL(18,2) DEFAULT 0;

	DECLARE tmpFundCoin INT DEFAULT 0;

	DECLARE tmpCurrDate date DEFAULT DATE(DATE_FORMAT(CURDATE(),'%Y-%m-01'));



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	# 余额、积分

	SELECT fundUsable,fundRebate INTO tmpFundUsable,tmpFundCoin FROM t_user WHERE userType=in_uType AND id=in_uid LIMIT 1;

	IF ISNULL(tmpFundUsable) THEN

		SET out_result = 1000;

		LEAVE _pb;

	END IF;



	# 当月余额收入/支出

	SELECT SUM(IF(f.tradertype>0,IF(f.orderId<1,handlesum,o.fundUsable),0)),SUM(IF(f.tradertype<0,IF(f.orderId<1,handlesum,o.fundUsable),0)) INTO tmpFundSumIn, tmpFundSumOut FROM t_fund_record f LEFT JOIN t_order o ON f.orderId=o.id

		WHERE f.uid=in_uid AND f.recordTime>tmpCurrDate;

	IF ISNULL(tmpFundSumIn) THEN

		SET tmpFundSumIn = 0;

	END IF;

	IF ISNULL(tmpFundSumOut) THEN

		SET tmpFundSumOut = 0;

	END IF;



	IF _error <> 0 THEN

		SET out_result = 90;

		LEAVE _pb;

	ELSE

		SET out_result = -1;

		SET out_fund = CONCAT(tmpFundUsable, ',', tmpFundCoin, ',', tmpFundSumIn, ',', tmpFundSumOut);

		SELECT * FROM v_t_fund_record_consumer WHERE uid=in_uid LIMIT 0,in_pageSize;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_login_user` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_login_user` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_login_user`(IN in_cellphone VARCHAR(20),IN in_openid VARCHAR(100),IN in_pwd VARCHAR(32), IN in_ip VARCHAR(32), IN in_ocode INT(11),IN in_millis BIGINT,IN in_counts INT(11),IN in_remarks VARCHAR(1024),OUT `out_error` int(10),OUT `out_msg` varchar(50))
_pb:BEGIN



	DECLARE _flag, _error INT(10) DEFAULT 0;



	DECLARE tmpInt, tmpInt0 INT DEFAULT 0;

	DECLARE tmpResult, tmpUid, tmpLong BIGINT DEFAULT 0;

	DECLARE tmpStr VARCHAR(100) DEFAULT NULL;

	DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	SELECT u.id,`password`,u.flag,u.islocked,errorcount,TIMESTAMPDIFF(SECOND,u.lockedtime,NOW()) INTO tmpUid,tmpStr,tmpInt,tmpInt0,tmpLong,tmpResult

		FROM t_user u

		WHERE u.flag>-1 AND (u.cellphone LIKE in_cellphone);

	IF ISNULL(tmpUid) OR tmpUid<1 THEN

		SET out_error = 1001;

		SET out_msg = '用户名或密码错误';

		LEAVE _pb;

	END IF;



	IF tmpInt0 = 1 THEN

		SET tmpResult = tmpResult * 1000;

		IF tmpResult < in_millis THEN

			SET tmpResult = (in_millis - tmpResult) / 60000 + 1;

			SET out_error = 1002;

			SET out_msg = CONVERT(CONCAT('该账户已经被锁定，请', tmpResult,'分钟后再试'),CHAR);

			LEAVE _pb;

		END IF;

	END IF;



	IF tmpInt = 2 THEN

		SET out_error = 1003;

		SET out_msg = '该用户已被禁用';

		LEAVE _pb;

	ELSEIF tmpInt = 1 THEN

		SET out_error = 1004;

		SET out_msg = '该账号异常，请联系客服';

		LEAVE _pb;

	ELSEIF tmpInt != 0 THEN

		SET out_error = 1005;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	IF tmpStr != in_pwd THEN

		SET tmpLong = tmpLong + 1;

		IF tmpLong >= in_counts THEN

			SET tmpLong = 0;

			SET tmpResult = 1;

		ELSE

			SET tmpResult = 0;

		END IF;

		UPDATE t_user SET errorcount=tmpLong,islocked=tmpResult,lockedtime=NOW() WHERE id=tmpUid;

		SELECT ROW_COUNT() INTO tmpResult;

		IF ISNULL(tmpResult) OR tmpResult != 1 THEN

			SET out_error = 2005;

			SET out_msg = '登录失败';

			LEAVE _pb;

		END IF;



		SET tmpInt = 2;

	ELSE

		UPDATE t_user SET islocked=0,errorcount=0 WHERE id=tmpUid;

		SELECT ROW_COUNT() INTO tmpResult;

		IF ISNULL(tmpResult) OR (tmpResult != 0 AND tmpResult != 1) THEN

			SET out_error = 2002;

			SET out_msg = '登录失败';

			LEAVE _pb;

		END IF;



		SET tmpResult = 0;

		UPDATE t_user SET openid=IF(id=tmpUid,in_openid,'') WHERE id=tmpUid OR openid LIKE in_openid;

		SELECT ROW_COUNT() INTO tmpResult;

		IF tmpResult < 1 THEN

			SET out_error = 2003;

			SET out_msg = '登录失败';

			LEAVE _pb;

		END IF;



		SET tmpInt = 3;

	END IF;



	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE (tmpUid,1,in_ocode,NOW(),in_remarks,in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF ISNULL(tmpResult) OR tmpResult < 1 THEN

		SET out_error = 2006;

		SET out_msg = '登录失败';

		LEAVE _pb;

	END IF;



	IF _error = 0 THEN

		SET out_error = -1;

		IF tmpInt = 3 THEN

			SET out_msg = '1';

			SELECT id,f_format_cell(cellphone) AS cellphone FROM t_user WHERE id=tmpUid;

		ELSE

			SET out_msg = '';

		END IF;

		LEAVE _pb;

	ELSE

		SET out_error = 1099;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_order_buy` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_order_buy` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_order_buy`(IN in_uid bigint,IN in_aid BIGINT,IN in_vtag BIGINT,IN in_tag BIGINT,IN in_opid BIGINT,in in_ocode int,in in_remarks varchar(1024),in in_ip varchar(25),OUT `out_error` int(10),OUT `out_msg` varchar(50))
_pb:BEGIN



	DECLARE _flag, _error INT(10) DEFAULT 0;



	DECLARE tmpResult, tmpOid, tmpAmount, tmpNeedPay BIGINT DEFAULT 0;

	DECLARE tmpOno, tmpStr, tmpNo VARCHAR(32) DEFAULT NULL;

	DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';

	DECLARE in_amount, vAmount DECIMAL(18,2) DEFAULT 0;



	SELECT COUNT(*) INTO tmpResult FROM t_address WHERE flag=0 AND uid=in_uid AND id=in_aid;

	IF tmpResult != 1 THEN

		SET out_error = 1001;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	IF in_vtag > 0 THEN

		SELECT v.amount INTO vAmount FROM t_voucher_log vl LEFT JOIN t_voucher v ON vl.vid=v.val WHERE vl.flag=0 AND vl.uid=in_uid AND vl.id=in_vtag;

		IF ISNULL(vAmount) OR vAmount < 0.01 THEN

			SET out_error = 1010;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;



		UPDATE t_voucher_log SET flag=1 WHERE uid=in_uid AND id=in_vtag;

		SELECT ROW_COUNT() INTO tmpResult;

		IF tmpResult != 1 THEN

			SET out_error = 1029;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

	END IF;



	INSERT INTO t_order(uid,tid,createTime,vTag,flag) VALUE(in_uid,1,NOW(),in_vtag,1);

	SELECT LAST_INSERT_ID() INTO tmpOid;

	IF ISNULL(tmpOid) OR tmpOid < 1 THEN

		SET out_error = 1010;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	INSERT INTO t_order_goods(orderId,cid,icon,title,price,counts)

		SELECT tmpOid,ogt.gid,g.icon,g.title,g.price,ogt.counts FROM t_order_goods_tmp ogt LEFT JOIN t_goods g ON ogt.gid=g.id WHERE g.flag=0 AND ogt.uid=in_uid AND ogt.tag=in_tag;

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1011;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SELECT SUM(price*counts) INTO in_amount FROM t_order_goods WHERE orderId=tmpOid;

	IF ISNULL(in_amount) OR in_amount < 0.01 THEN

		SET out_error = 1002;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SET tmpNeedPay = 1;

	SET vAmount = in_amount - vAmount;

	IF vAmount < 0.01 THEN

		SET tmpNeedPay = 0;

		SET vAmount = 0;

	END IF;



	SET tmpAmount = ROUND(vAmount * 100);

	SET tmpOno = f_format_ono(tmpAmount, 1);

	UPDATE t_order o LEFT JOIN t_address a ON o.uid=a.uid SET o.ono=tmpOno,o.amount=in_amount,o.realAmount=vAmount,o.realName=a.realName,o.cellphone=a.cellphone,

		o.address=CONCAT(a.addr,a.address),o.flag=IF(tmpNeedPay = 1,1,3) WHERE o.id=tmpOid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1012;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE (in_opid, 1, in_ocode, NOW(), in_remarks, in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1011;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	IF _error = 0 THEN

		SET out_error = -1;

		SET out_msg = CONVERT(CONCAT(tmpOid, ',', tmpOno, ',', in_amount, ',', tmpAmount, ',', tmpNeedPay), CHAR);

		LEAVE _pb;

	ELSE

		SET out_error = 1099;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_order_finish` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_order_finish` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_order_finish`(IN in_uid bigint,IN in_oid BIGINT,IN in_platform BIGINT,IN in_keyCode VARCHAR(32),IN in_uType INT,in in_ocode int,in in_remarks varchar(1024),in in_ip varchar(25),OUT `out_error` int(10),OUT `out_msg` varchar(50))
_pb:BEGIN



	DECLARE _error, tmpType INT(10) DEFAULT 0;



	DECLARE tmpResult BIGINT DEFAULT 0;

	DECLARE tmpUid, tmpAid, tmpAUid, tmpRUid, tmpCoin BIGINT DEFAULT 0;

	DECLARE tmpAmount, tmpAScale, tmpRScale, tmpWScale DECIMAL(18,2) DEFAULT 0;

	DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';

	DECLARE tmpCurrTimeStr datetime DEFAULT NOW();



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	SET tmpResult = 0;

	SELECT

		COUNT(*),o.uid,u.referee,o.tid,o.aid,FLOOR(o.realAmount),o.amount,wu.referee,s.agent,s.refereeScale,s.washScale INTO tmpResult,tmpUid,tmpRUid,tmpType,tmpAid,tmpCoin,tmpAmount,tmpAUid,tmpAScale, tmpRScale, tmpWScale

	FROM t_order o LEFT JOIN t_user wu ON o.wid=wu.id LEFT JOIN t_user au ON wu.referee=au.id LEFT JOIN t_user u ON u.id=o.uid LEFT JOIN t_user_scale s ON s.uid=au.id WHERE o.flag=5 AND o.id=in_oid AND o.wid=in_uid;

	IF tmpResult != 1 THEN

		SET out_error = 1000;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	# 更新订单状态

	SET tmpResult = 0;

	UPDATE t_order SET flag=6,finishTime=tmpCurrTimeStr WHERE id=in_oid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1020;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	# 更新订单图片信息

	SET tmpResult = 0;

	UPDATE t_order_img SET uid=tmpUid,aid=tmpAid WHERE orderId=in_oid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 8 THEN

		SET out_error = 1021;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	# 代理

	SET tmpResult = 0;

	SET tmpAScale = FLOOR(tmpAScale * tmpAmount) / 100;

	INSERT INTO t_fund_record(uid,fType,handleSum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId) SELECT id,63,tmpAScale,fundUsable,fundRebate,in_platform,1,tmpCurrTimeStr,in_oid FROM t_user WHERE userType=3 AND id=tmpAUid;

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1010;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	SET tmpResult = 0;

	UPDATE t_user SET fundUsable=fundUsable+tmpAScale WHERE id=tmpAUid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1011;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	IF tmpAUid != in_uid AND tmpAUid != tmpRUid THEN

		CALL p_sign_update(tmpAUid, in_keyCode, tmpResult);

		IF tmpResult != -1 THEN

			SET out_error = 1012;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

	END IF;

	SET tmpResult = 0;

	INSERT INTO t_fund_record(uid,fType,handleSum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId) SELECT id,23,tmpAScale,fundUsable,fundRebate,tmpAUid,-1,tmpCurrTimeStr,in_oid FROM t_user WHERE userType=100 AND id=in_platform;

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1013;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	# 洗车人

	SET tmpResult = 0;

	SET tmpWScale = FLOOR(tmpWScale * tmpAmount) / 100;

	INSERT INTO t_fund_record(uid,fType,handleSum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId) SELECT id,44,tmpWScale,fundUsable,fundRebate,in_platform,1,tmpCurrTimeStr,in_oid FROM t_user WHERE (userType=3 OR userType=2) AND id=in_uid;

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1014;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	SET tmpResult = 0;

	UPDATE t_user SET fundUsable=fundUsable+tmpWScale WHERE id=in_uid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1015;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	IF in_uid != tmpRUid THEN

		CALL p_sign_update(in_uid, in_keyCode, tmpResult);

		IF tmpResult != -1 THEN

			SET out_error = 1031;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

	END IF;

	SET tmpResult = 0;

	INSERT INTO t_fund_record(uid,fType,handleSum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId) SELECT id,24,tmpWScale,fundUsable,fundRebate,in_uid,-1,tmpCurrTimeStr,in_oid FROM t_user WHERE userType=100 AND id=in_platform;

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1016;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	# 推荐人

	IF tmpRUid > 0 THEN # 已推荐人

		SET tmpResult = 0;

		SET tmpRScale = FLOOR(tmpRScale * tmpAmount) / 100;

		INSERT INTO t_fund_record(uid,fType,handleSum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId) SELECT id,82,tmpRScale,fundUsable,fundRebate,in_platform,1,tmpCurrTimeStr,in_oid FROM t_user WHERE id=tmpRUid;

		SELECT LAST_INSERT_ID() INTO tmpResult;

		IF tmpResult < 1 THEN

			SET out_error = 1017;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

		SET tmpResult = 0;

		UPDATE t_user SET fundUsable=fundUsable+tmpRScale WHERE id=tmpRUid;

		SELECT ROW_COUNT() INTO tmpResult;

		IF tmpResult != 1 THEN

			SET out_error = 1018;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

		CALL p_sign_update(tmpRUid, in_keyCode, tmpResult);

		IF tmpResult != -1 THEN

			SET out_error = 1019;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

		SET tmpResult = 0;

		INSERT INTO t_fund_record(uid,fType,handleSum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId) SELECT id,22,tmpRScale,fundUsable,fundRebate,tmpRUid,-1,tmpCurrTimeStr,in_oid FROM t_user WHERE userType=100 AND id=in_platform;

		SELECT LAST_INSERT_ID() INTO tmpResult;

		IF tmpResult < 1 THEN

			SET out_error = 1020;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

	ELSE

		SET tmpRScale = 0;

	END IF;

	# 下单人积分

	IF tmpCoin > 0 THEN

		SET tmpResult = 0;

		UPDATE t_user SET fundRebate=fundRebate+tmpCoin WHERE id=tmpUid;

		SELECT ROW_COUNT() INTO tmpResult;

		IF tmpResult != 1 THEN

			SET out_error = 1021;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

		CALL p_sign_update(tmpUid, in_keyCode, tmpResult);

		IF tmpResult != -1 THEN

			SET out_error = 1022;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

		INSERT INTO t_fund_record_coin(uid,orderId,tid,coin,recordTime) VALUE (tmpUid, in_oid, tmpType, tmpCoin, tmpCurrTimeStr);

		SELECT LAST_INSERT_ID() INTO tmpResult;

		IF tmpResult < 1 THEN

			SET out_error = 1023;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

	END IF;



	# 更新平台账号，资金信息

	SET tmpResult = 0;

	UPDATE t_user SET fundUsable=fundUsable-(tmpAScale + tmpWScale + tmpRScale) WHERE id=in_platform;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

			SET out_error = 1025;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

	CALL p_sign_update(in_platform, in_keyCode, tmpResult);

	IF tmpResult != -1 THEN

		SET out_error = 1024;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE (in_uid, in_uType, in_ocode, tmpCurrTimeStr, in_remarks, in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1040;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	# 用于资金记录查询

	SET tmpResult = 0;

	INSERT INTO t_order_amount_scale(orderId,wid,aid,rid,wAmount,aAmount,rAmount, recordTime, timeInt)

		VALUE (in_oid, in_uid, tmpAUid, tmpRUid, tmpWScale, tmpAScale, tmpRScale, tmpCurrTimeStr, CONVERT(DATE_FORMAT(tmpCurrTimeStr,'%Y%m%d'),UNSIGNED));

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1041;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	IF _error = 0 THEN

		SET out_error = -1;

		SET out_msg = '';

		LEAVE _pb;

	ELSE

		SET out_error = 1099;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_order_init` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_order_init` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_order_init`(IN in_uid bigint,IN in_uType INT(5),IN in_cid BIGINT,IN in_aid BIGINT,IN in_mid INT(11),IN in_lng DECIMAL(18,15),IN in_lat DECIMAL(18,15),IN in_addrStr VARCHAR(100),IN in_subTime VARCHAR(20),IN in_addressDetail VARCHAR(100),IN in_fund INT(5),IN in_vTag BIGINT,IN in_ext VARCHAR(256),IN in_opid BIGINT,in in_ocode int,in in_remarks varchar(1024),in in_ip varchar(25),OUT `out_error` int(10),OUT `out_msg` varchar(50))
_pb:BEGIN



	DECLARE _error, tmpFlag, needPay INT(10) DEFAULT 0;



	DECLARE tmpResult, tmpOid, tmpAmount BIGINT DEFAULT 0;

	DECLARE tmpOno VARCHAR(32) DEFAULT NULL;

	DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';

	DECLARE tmpRealName, tmpIdno VARCHAR(30) DEFAULT '';

	DECLARE tmpMoney, tmpTotal, tmpFund DECIMAL(18,2) DEFAULT 0;

	DECLARE tmpType INT(5) DEFAULT 1;

	DECLARE tmpCurrTimeStr datetime DEFAULT NOW();



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	SET tmpResult = 0;

	SELECT COUNT(*),c.price+ce.price,c.flag INTO tmpResult, tmpTotal, tmpFlag FROM t_auto a LEFT JOIN t_auto_type t ON a.tid=t.id LEFT JOIN t_combo_ext ce ON t.id=ce.abid LEFT JOIN t_combo c ON c.id=ce.cid

		WHERE a.id=in_aid AND c.id=in_cid AND a.uid=in_uid;

	IF tmpResult != 1 THEN

		SET out_error = 1000;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	ELSEIF tmpFlag != 0 THEN

		SET out_error = 1001;

		SET out_msg = '该套餐已经下架';

		LEAVE _pb;

	ELSEIF ISNULL(tmpTotal) OR tmpTotal < 0.01 THEN

		SET out_error = 1002;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	# 使用余额抵扣

	IF in_fund = 1 THEN

		SET tmpResult = 0;

		SELECT COUNT(*),tmpTotal - fundUsable INTO tmpResult,tmpMoney FROM t_user WHERE userType=in_uType AND flag=0 AND id=in_uid;

		IF tmpResult != 1 THEN

			SET out_error = 1010;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;



		IF tmpMoney < 0.01 THEN

			SET tmpMoney = 0;

			SET tmpFund = tmpTotal;

		ELSE

			SET tmpFund = tmpTotal - tmpMoney;

		END IF;

	ELSE

		SET tmpFund = 0;

		SET tmpMoney = tmpTotal;

	END IF;



	# 新增订单

	SET tmpOid = 0;

	INSERT INTO t_order(uid,aid,cid,amount,realAmount,fundUsable,tid,createTime,subscribeTime,pmid,address,lng,lat,vTag,ext)

		VALUE(in_uid, in_aid, in_cid, tmpTotal, tmpMoney, tmpFund, tmpType, tmpCurrTimeStr, in_subTime, in_mid, in_addrStr, in_lng, in_lat, in_vTag, in_ext);

	SELECT LAST_INSERT_ID() INTO tmpOid;

	IF tmpOid < 1 THEN

		SET out_error = 1030;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	# 更新订单号

	SET tmpAmount = ROUND(tmpMoney * 100);

	SET tmpOno = f_format_ono(tmpOid, tmpAmount, tmpType);

	SET tmpResult = 0;

	UPDATE t_order SET ono=tmpOno WHERE id=tmpOid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1031;

		SET out_msg = CONCAT(tmpOid,',',tmpOno,',',tmpResult);#STR_ERROR

		LEAVE _pb;

	END IF;

	# 新增订单套餐记录

	SET tmpResult = 0;

	INSERT INTO t_order_combo(orderId,title,price) SELECT tmpOid,title,tmpTotal FROM t_combo WHERE id=in_cid;

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpOid < 1 THEN

		SET out_error = 1032;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE (in_opid, in_uType, in_ocode, tmpCurrTimeStr, in_remarks, in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1040;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SET needPay = IF(tmpAmount=0, 0, 1);



	IF _error = 0 THEN

		SET out_error = -1;

		SET out_msg = '';

		SELECT tmpOid AS orderId, tmpOno AS ono, CONVERT(tmpTotal, CHAR) AS amountTotal, CONVERT(tmpMoney, CHAR) AS amountStr, tmpAmount AS amount, needPay, tmpRealName, tmpIdno;

		LEAVE _pb;

	ELSE

		SET out_error = 1099;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

END */$$
