/* Procedure structure for procedure `p_order_pay_fund` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_order_pay_fund` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_order_pay_fund`(IN in_uid bigint,IN in_uType INT(5),IN in_accPlatform BIGINT,IN in_oid BIGINT,IN in_ono VARCHAR(32),IN in_keyCode VARCHAR(32),IN in_opid BIGINT,in in_ocode int,in in_remarks varchar(1024),in in_ip varchar(25),OUT `out_error` int(10),OUT `out_msg` varchar(50))
_pb:BEGIN



	DECLARE _error, tmpFlag INT(10) DEFAULT 0;



	DECLARE tmpResult BIGINT DEFAULT 0;

	DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';

	DECLARE tmpMoney, tmpTotal, tmpFund DECIMAL(18,2) DEFAULT 0;

	DECLARE tmpType INT(5) DEFAULT 1;

	DECLARE tmpCurrTime datetime DEFAULT NOW();



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	SET tmpResult = 0;

	CALL p_sign_check(in_uid, in_keyCode, tmpResult);

	IF tmpResult != -1 THEN

		SET out_error = 7777;

		SET out_msg = '账号异常，请联系平台方';

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	SELECT COUNT(*),fundUsable INTO tmpResult, tmpFund FROM t_user WHERE userType=in_uType AND id=in_uid;

	IF tmpResult != 1 THEN

		SET out_error = 1010;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	SET tmpFlag = -1;

	SELECT COUNT(*),flag,realAmount,fundUsable INTO tmpResult, tmpFlag, tmpMoney, tmpTotal FROM t_order WHERE uid=in_uid AND id=in_oid AND ono LIKE in_ono;

	IF tmpResult != 1 OR tmpMoney >= 0.01 THEN

		SET out_error = 1011;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	ELSEIF tmpTotal > tmpFund THEN

		SET out_error = 1019;

		SET out_msg = '余额不足抵扣，请刷新页面后重新下单';

		LEAVE _pb;

	ELSEIF tmpFlag = 2 THEN

		SET out_error = 1012;

		SET out_msg = '下单失败';

		LEAVE _pb;

	ELSEIF tmpFlag = 3 THEN

		SET out_error = -1;

		SET out_msg = '下单成功';

		LEAVE _pb;

	ELSEIF tmpFlag != 0 THEN

		SET out_error = 1013;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	# 客户资金记录

	SET tmpResult = 0;

	INSERT INTO t_fund_record(uid,ftype,handlesum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId) SELECT id,1,tmpTotal,fundUsable,fundRebate,in_accPlatform,-1,tmpCurrTime,in_oid FROM t_user WHERE userType=in_uType AND id=in_uid;

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1030;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	# 更新客户资金

	SET tmpResult = 0;

	UPDATE t_user SET fundUsable=fundUsable-tmpTotal WHERE userType=in_uType AND id=in_uid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1031;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	# 平台资金记录

	SET tmpResult = 0;

	INSERT INTO t_fund_record(uid,ftype,handlesum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId) SELECT id,21,tmpTotal,fundUsable,fundRebate,in_uid,1,tmpCurrTime,in_oid FROM t_user WHERE userType=100 AND id=in_accPlatform;

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1032;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	# 更新平台资金

	SET tmpResult = 0;

	UPDATE t_user SET fundUsable=fundUsable+tmpTotal WHERE userType=100 AND id=in_accPlatform;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1033;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	# 更新订单信息

	SET tmpResult = 0;

	UPDATE t_order SET flag=3,payTime=tmpCurrTime WHERE id=in_oid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1041;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	# 下单支付日志

	SET tmpResult = 0;

	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE (in_opid, in_uType, in_ocode, tmpCurrTime, in_remarks, in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1040;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	# 更新签名

	SET tmpResult = 0;

	CALL p_sign_update(in_uid, in_keyCode, tmpResult);

	IF tmpResult != -1 THEN

		SET out_error = 1090;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

	SET tmpResult = 0;

	CALL p_sign_update(in_accPlatform, in_keyCode, tmpResult);

	IF tmpResult != -1 THEN

		SET out_error = 1091;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	IF _error = 0 THEN

		SET out_error = -1;

		SET out_msg = '下单成功';

		SELECT CONVERT(fundUsable,CHAR) AS fundUsable,CONVERT(fundRebate,CHAR) AS fundRebate FROM t_user WHERE userType=tmpType AND id=in_uid;

		LEAVE _pb;

	ELSE

		SET out_error = 1099;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

