	SET tmpResult = 0;

	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE (in_uid, in_uType, in_ocode, tmpCurrTime, in_remarks, in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1082;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

