		SELECT CONVERT(fundUsable,CHAR) AS fundUsable,fundRebate FROM t_user WHERE userType=in_uType AND id=in_uid;

		LEAVE _pb;

	ELSE

		SET out_error = 1099;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

END */$$
