/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_order_pay_tl_checker`(IN in_uid bigint,IN in_uType INT,IN in_oid BIGINT,IN in_ono VARCHAR(32),IN in_bid BIGINT,IN in_keyCode VARCHAR(32),OUT `out_error` int(10),OUT `out_msg` varchar(50))
