		SET out_error = 7777;

		SET out_msg = '账号异常，请联系平台方';

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	SELECT COUNT(*),fundUsable INTO tmpResult, tmpFund FROM t_user WHERE userType=in_uType AND id=in_uid;

	IF tmpResult != 1 THEN

		SET out_error = 1010;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



