	SET tmpFlag = -1;

	SELECT COUNT(*),flag,realAmount,fundUsable INTO tmpResult, tmpFlag, tmpMoney, tmpTotal FROM t_order WHERE uid=in_uid AND id=in_oid AND ono LIKE in_ono;

	IF tmpResult != 1 OR tmpMoney <= 0.01 THEN

		SET out_error = 1011;

		SET out_msg = STR_ERROR;

