/* Procedure structure for procedure `p_order_pay_tl_result` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_order_pay_tl_result` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_order_pay_tl_result`(IN in_res int(5),IN in_uid bigint,IN in_uType INT,IN in_oid BIGINT,IN in_ono VARCHAR(32),IN in_amount BIGINT,IN in_tlOno VARCHAR(50),IN in_platform BIGINT,IN in_keyCode VARCHAR(32),OUT `out_error` int(10))
_pb:BEGIN



	DECLARE _error INT(10) DEFAULT 0;



	DECLARE tmpResult, tmpAmount BIGINT DEFAULT 0;

	DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';

	DECLARE tmpAgreeID VARCHAR(40) DEFAULT '未知错误';

	DECLARE tmpMoney, tmpTotal, tmpFund, tmpUserFun DECIMAL(18,2) DEFAULT 0;

	DECLARE tmpFlag INT(5) DEFAULT -1;

	DECLARE tmpCurrTime datetime DEFAULT NOW();



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	SELECT COUNT(*),flag,ROUND(realAmount * 100),fundUsable,amount INTO tmpResult,tmpFlag,tmpAmount,tmpFund,tmpTotal FROM t_order WHERE uid=in_uid AND id=in_oid AND ono LIKE in_ono;

	IF tmpResult != 1 THEN

		SET out_error = 404;

		LEAVE _pb;

	ELSEIF tmpFlag > 1 THEN

		SET out_error = 200;

		LEAVE _pb;

	ELSEIF tmpFlag != 0 THEN

		SET out_error = 404;

		LEAVE _pb;

	ELSEIF ABS(tmpAmount - in_amount) > 0 THEN

		SET out_error = 404;

		LEAVE _pb;

	END IF;



	IF in_res = 2 THEN

		IF tmpFund < 0.01 THEN

			SET tmpResult = 0;

			UPDATE t_user SET fundUsable=fundUsable+tmpFund WHERE userType=in_uType AND id=in_uid;

			SELECT ROW_COUNT() INTO tmpResult;

			IF tmpResult != 1 THEN

				SET out_error = 500;

				LEAVE _pb;

			END IF;



			CALL p_sign_update(in_uid, in_keyCode, tmpResult);

			IF tmpResult != -1 THEN

				SET out_error = 500;

				LEAVE _pb;

			END IF;

		END IF;

	ELSEIF in_res = 3 THEN

		SET tmpResult = 0;

		INSERT INTO t_fund_record(uid,ftype,handlesum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId)

			SELECT id,1,tmpTotal,fundUsable,fundRebate,in_platform,-1,tmpCurrTime,in_oid FROM t_user WHERE userType=in_uType AND id=in_uid;

		SELECT LAST_INSERT_ID() INTO tmpResult;

		IF tmpResult < 1 THEN

			SET out_error = 500;

			LEAVE _pb;

		END IF;



		SET tmpResult = 0;

		INSERT INTO t_fund_record(uid,ftype,handlesum,fundUsable,fundRebate,trader,tradertype,recordtime,orderId)

			SELECT id,21,tmpTotal,fundUsable,fundRebate,in_uid,1,tmpCurrTime,in_oid FROM t_user WHERE id=in_platform;

		SELECT LAST_INSERT_ID() INTO tmpResult;

		IF tmpResult < 1 THEN

			SET out_error = 500;

			LEAVE _pb;

		END IF;



		SET tmpResult = 0;

		UPDATE t_user SET fundUsable=fundUsable+tmpTotal WHERE id=in_platform;

		SELECT ROW_COUNT() INTO tmpResult;

		IF tmpResult != 1 THEN

			SET out_error = 500;

			LEAVE _pb;

		END IF;



		CALL p_sign_update(in_platform, in_keyCode, tmpResult);

		IF tmpResult != -1 THEN

			SET out_error = 500;

			LEAVE _pb;

		END IF;

	END IF;



	SET tmpResult = 0;

	UPDATE t_order SET flag=in_res, payTime=tmpCurrTime, extNo=in_tlOno WHERE flag=0 AND id=in_oid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 500;

		LEAVE _pb;

	END IF;



	IF _error = 0 THEN

		SET out_error = 200;

		LEAVE _pb;

	ELSE

		SET out_error = 500;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_order_rating` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_order_rating` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_order_rating`(IN in_uid bigint,IN in_uType INT(5),IN in_oid BIGINT,IN in_rating INT(5),IN in_review longtext,in in_ocode int,in in_remarks varchar(1024),in in_ip varchar(25),OUT `out_error` int(10), OUT out_ret VARCHAR(10))
_pb:BEGIN



     DECLARE _error INT(10) DEFAULT 0;



     DECLARE tmpResult, tmpWID, tmpRID BIGINT DEFAULT 0;

     DECLARE tmpStarRatingStr VARCHAR(10) DEFAULT NULL;

     DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';



     DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



     SET tmpResult = -1;

		SET tmpRID = -1;

     SELECT COUNT(*),starRating,o.wid,r.id INTO tmpResult,tmpStarRatingStr,tmpWID,tmpRID FROM t_order o LEFT JOIN t_order_review r ON r.orderId=o.id WHERE r.orderId=in_oid;

     IF tmpResult > 0 AND tmpRID > 0 THEN

         SET out_error = -1;

         SET out_ret = tmpStarRatingStr;

         LEAVE _pb;

     END IF;



     SET tmpResult = -1;

     INSERT INTO t_order_review(orderId,uid,starRating,ext) VALUE(in_oid, in_uid, in_rating+1, in_review);

     SELECT LAST_INSERT_ID() INTO tmpResult;

     IF tmpResult < 1 THEN

         SET out_error = 1000;

         SET out_ret = STR_ERROR;

         LEAVE _pb;

     END IF;



     IF in_rating = 0 THEN

         SET in_rating = 2;

     ELSEIF in_rating = 1 THEN

         SET in_rating = 1;

     ELSEIF in_rating = 2 THEN

         SET in_rating = 0;

     ELSEIF in_rating = 3 THEN

         SET in_rating = -3;

     ELSEIF in_rating = 4 THEN

         SET in_rating = -5;

     ELSE

         SET in_rating = 0;

     END IF;



     IF in_rating > 0 THEN

         UPDATE t_user SET score=score+in_rating,score=IF(score>100,100,score) WHERE id=tmpWID;

     ELSEIF in_rating < 0 THEN

         UPDATE t_user SET score=score+in_rating,score=IF(score<0,0,score) WHERE id=tmpWID;

     END IF;



     SET tmpResult = 0;

     INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE(in_uid, in_uType, in_oCode, NOW(), in_remarks, in_ip);

     SELECT LAST_INSERT_ID() INTO tmpResult;

     IF tmpResult < 1 THEN

         SET out_error = 1060;

         SET out_ret = STR_ERROR;

         LEAVE _pb;

     END IF;



     IF _error = 0 THEN

         SET out_error = -1;

         SELECT starRating INTO out_ret FROM t_order_review WHERE orderId=in_oid;

         LEAVE _pb;

     ELSE

         SET out_error = 1099;

         LEAVE _pb;

     END IF;

 END */$$
DELIMITER ;

/* Procedure structure for procedure `p_order_refund` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_order_refund` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_order_refund`(IN in_uid bigint,IN in_uType INT(5),IN in_accPlatform BIGINT,IN in_oid BIGINT,IN in_keyCode VARCHAR(32),in in_ocode int,in in_remarks varchar(1024),in in_ip varchar(25),OUT `out_error` int(10),OUT `out_msg` varchar(50))
_pb:BEGIN



     DECLARE _error INT(10) DEFAULT 0;



     DECLARE tmpResult BIGINT DEFAULT 0;

     DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';

     DECLARE tmpFund, tmpTotal DECIMAL(18,2) DEFAULT 0;

     DECLARE tmpFlag INT(5) DEFAULT 0;

     DECLARE tmpCurrTime datetime DEFAULT NOW();



     DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



     SET tmpResult = 0;

     SELECT COUNT(*),flag,amount,fundUsable INTO tmpResult,tmpFlag,tmpTotal,tmpFund FROM t_order WHERE id=in_oid AND uid=in_uid;

     IF tmpResult != 1 OR tmpFlag < 3 THEN

         SET out_error = 1000;

         SET out_msg = STR_ERROR;

         LEAVE _pb;

     ELSEIF tmpFlag > 6 THEN

         SET out_error = 1010;

         SET out_msg = '未知错误，请刷新页面';

         LEAVE _pb;

     ELSEIF tmpFlag > 4 THEN

         SET out_error = 1011;

         SET out_msg = '该订单已经开始洗车，无法取消';

         LEAVE _pb;

     END IF;



     SET tmpResult = 0;

     INSERT INTO t_fund_record(uid,ftype,handlesum,tradertype,recordtime,orderId) SELECT id,9,tmpTotal,1,tmpCurrTime,in_oid FROM t_user WHERE userType=in_uType AND id=in_uid;

     SELECT LAST_INSERT_ID() INTO tmpResult;

     IF tmpResult < 1 THEN

         SET out_error = 1020;

         SET out_msg = STR_ERROR;

         LEAVE _pb;

     END IF;



     # 有余额抵扣

     IF tmpFund >= 0.01 THEN

         SET tmpResult = 0;

         UPDATE t_user SET fundUsable=fundUsable+tmpFund WHERE id=in_uid;

         SELECT ROW_COUNT() INTO tmpResult;

         IF tmpResult != 1 THEN

             SET out_error = 1030;

             SET out_msg = STR_ERROR;

             LEAVE _pb;

         END IF;



         CALL p_sign_update(in_uid, in_keyCode, tmpResult);

         IF tmpResult != -1 THEN

             SET out_error = 1031;

             SET out_msg = STR_ERROR;

             LEAVE _pb;

         END IF;

     END IF;



     SET tmpResult = 0;

     INSERT INTO t_fund_record(uid,ftype,handlesum,tradertype,recordtime,orderId) SELECT id,29,tmpTotal,-1,tmpCurrTime,in_oid FROM t_user WHERE id=in_accPlatform;

     SELECT LAST_INSERT_ID() INTO tmpResult;

     IF tmpResult < 1 THEN

         SET out_error = 1040;

         SET out_msg = STR_ERROR;

         LEAVE _pb;

     END IF;

     SET tmpResult = 0;

     UPDATE t_user SET fundUsable=fundUsable-tmpTotal WHERE id=in_accPlatform;

     SELECT ROW_COUNT() INTO tmpResult;

     IF tmpResult != 1 THEN

         SET out_error = 1042;

         SET out_msg = STR_ERROR;

         LEAVE _pb;

     END IF;

     CALL p_sign_update(in_accPlatform, in_keyCode, tmpResult);

     IF tmpResult != -1 THEN

         SET out_error = 1041;

         SET out_msg = STR_ERROR;

         LEAVE _pb;

     END IF;



     SET tmpResult = 0;

     UPDATE t_order SET flag=8 WHERE id=in_oid;

     SELECT ROW_COUNT() INTO tmpResult;

     IF tmpResult != 1 THEN

         SET out_error = 1050;

         SET out_msg = STR_ERROR;

         LEAVE _pb;

     END IF;



     SET tmpResult = 0;

     INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE(in_uid, in_uType, in_oCode, tmpCurrTime, in_remarks, in_ip);

     SELECT LAST_INSERT_ID() INTO tmpResult;

     IF tmpResult < 1 THEN

         SET out_error = 1060;

         SET out_msg = STR_ERROR;

         LEAVE _pb;

     END IF;



     IF _error = 0 THEN

         SET out_error = -1;

         SET out_msg = '下单成功';

         SELECT

             IF(realAmount < 0.01, 0, 1) AS needExt,o.wid,o.ono,o.extNo,CONVERT(o.amount,CHAR) AS amount,CONVERT(o.realAmount,CHAR) AS realAmount,DATE_FORMAT(o.payTime,'%Y-%m-%d %H:%i:%s') AS payTime,u.openid,c.title,

             CONVERT(ou.fundUsable,CHAR) AS fundUsable,ou.fundRebate AS fundRebate

         FROM t_order o LEFT JOIN t_user ou ON ou.id=o.uid LEFT JOIN t_user u ON o.wid=u.id LEFT JOIN t_order_combo c ON c.orderId=o.id WHERE o.id=in_oid;

         LEAVE _pb;

     ELSE

         SET out_error = 1099;

         SET out_msg = STR_ERROR;

         LEAVE _pb;

     END IF;

 END */$$
DELIMITER ;

/* Procedure structure for procedure `p_order_update` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_order_update` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_order_update`(IN in_uid bigint,IN in_oid BIGINT,IN in_opid BIGINT,in in_ocode int,in in_remarks varchar(1024),in in_ip varchar(25),OUT `out_error` int(10))
_pb:BEGIN



	DECLARE _flag, _error INT(10) DEFAULT 0;



	DECLARE tmpResult, tmpOid BIGINT DEFAULT 0;

	DECLARE tmpOno, tmpStr, tmpNo VARCHAR(32) DEFAULT NULL;

	DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';



	UPDATE t_order SET flag=3 WHERE flag=1 AND id=in_oid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1012;

		LEAVE _pb;

	END IF;



	INSERT INTO t_fund_record(uid,ftype,handlesum,tradertype,recordtime,orderId) SELECT uid,1,amount,-1,NOW(),id FROM t_order WHERE id=in_oid;

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1013;

		LEAVE _pb;

	END IF;



	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE (in_opid, 1, in_ocode, NOW(), in_remarks, in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1011;

		LEAVE _pb;

	END IF;



	UPDATE t_goods g LEFT JOIN t_order_goods og ON g.id=og.cid SET g.sales=g.sales+og.counts WHERE og.orderId=in_oid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_error = 1014;

		LEAVE _pb;

	END IF;



	IF _error = 0 THEN

		SET out_error = -1;

		LEAVE _pb;

	ELSE

		SET out_error = 1099;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_referee_init` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_referee_init` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_referee_init`(IN in_uid BIGINT, IN in_uType INT(5), OUT `out_error` INT(10))
_pb:BEGIN



	DECLARE _error INT DEFAULT 0;



	DECLARE tmpResult BIGINT DEFAULT 0;

	DECLARE tmpCounts, tmpCountsTotal INT DEFAULT 0;

	DECLARE tmpAmount DECIMAL(18,2) DEFAULT 0;

	DECLARE tmpCurrDate date DEFAULT CURRENT_DATE();



  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	# 推荐总人数

	SELECT COUNT(*) INTO tmpCountsTotal FROM t_user WHERE userType=in_uType AND referee=in_uid;



	# 今日推荐人数

	SELECT COUNT(*) INTO tmpCounts FROM t_user WHERE userType=in_uType AND referee=in_uid AND createtime>tmpCurrDate;



	# 推荐总收益

	SELECT SUM(handlesum) INTO tmpAmount FROM t_fund_record WHERE ftype=82 AND trader=in_uid;



	IF _error <> 0 THEN

		SET out_error = 70;

		LEAVE _pb;

	ELSE

		SET out_error = -1;

		SELECT tmpCounts AS counts, tmpCountsTotal AS totalCounts, IF(ISNULL(tmpAmount), '0.00', CONVERT(tmpAmount, CHAR)) AS amountSum;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_reg` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_reg` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_reg`(IN in_cellphone VARCHAR(13),IN in_pwd VARCHAR(32), IN in_code VARCHAR(6), IN in_ip VARCHAR(32), IN in_ocode INT(11),IN in_millis BIGINT,OUT `out_error` int(10),OUT `out_msg` varchar(50))
_pb:BEGIN



	DECLARE _flag, _error INT(10) DEFAULT 0;



	DECLARE tmpResult, tmpUid BIGINT DEFAULT 0;

	DECLARE tmpStr VARCHAR(100) DEFAULT NULL;

	DECLARE STR_ERROR VARCHAR(10) DEFAULT '未知错误';



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	SELECT id INTO tmpResult FROM t_user WHERE flag>-1 AND cellphone LIKE in_cellphone;

	IF tmpResult > 0 THEN

		SET out_error = 1001;

		SET out_msg = '该手机号已经被使用';

		LEAVE _pb;

	END IF;



	INSERT INTO t_user(cellphone,`password`,createtime) VALUE(in_cellphone,in_pwd,NOW());

	SELECT LAST_INSERT_ID() INTO tmpUid;

	IF ISNULL(tmpUid) OR tmpUid < 1 THEN

		SET out_error = 1005;

		SET out_msg = '注册失败';

		LEAVE _pb;

	END IF;



	SET tmpResult = -1;

	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE (tmpUid,1,in_ocode,NOW(),'',in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_error = 1008;

		SET out_msg = '注册失败';

		LEAVE _pb;

	END IF;



	IF _error = 0 THEN

		SET out_error = -1;

		SET out_msg = CONVERT(tmpUid,CHAR);

		LEAVE _pb;

	ELSE

		SET out_error = 1099;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_sign_check` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_sign_check` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_sign_check`(IN `in_uid` bigint,IN in_keyCode VARCHAR(32),OUT `out_result` int(10))
_pb:BEGIN



	DECLARE nsign0,nsign1, tmpSign0, tmpSign1 VARCHAR(32) DEFAULT '';

	DECLARE _error, tmpCounts INT DEFAULT 0;



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	SELECT COUNT(*),sign0,sign1,MD5(CONCAT(in_keyCode, fundTotal + fundUsable + fundfrozen + fundRebate)),MD5(CONCAT(in_keyCode, fundTotal, fundUsable, fundfrozen, fundRebate)) INTO tmpCounts,nsign0,nsign1,tmpSign0,tmpSign1

		FROM t_user WHERE id=in_uid;

	IF tmpCounts != 1 THEN

		SET out_result = 91;

		LEAVE _pb;

	ELSEIF ISNULL(nsign0) OR ISNULL(tmpSign1) OR nsign0 != tmpSign0 OR nsign1 != tmpSign1 THEN

		SET out_result = 92;

		LEAVE _pb;

	END IF;



	IF _error <> 0 THEN

		SET out_result = 90;

		LEAVE _pb;

	ELSE

		SET out_result = -1;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_sign_update` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_sign_update` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_sign_update`(IN `in_uid` bigint,IN `in_keyCode` VARCHAR(32),OUT `out_result` int(10))
_pb:BEGIN



	DECLARE _error INT DEFAULT 0;

	DECLARE tmpResult BIGINT DEFAULT 0;



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	UPDATE t_user SET sign0=MD5(CONCAT(in_keyCode, fundTotal + fundUsable + fundfrozen + fundRebate)), sign1=MD5(CONCAT(in_keyCode, fundTotal, fundUsable, fundfrozen, fundRebate)) WHERE id=in_uid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_result = 91;

		LEAVE _pb;

	END IF;



	IF _error <> 0 THEN

		SET out_result = 90;

		LEAVE _pb;

	ELSE

		SET out_result = -1;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_sms_checker` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_sms_checker` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_sms_checker`(IN `in_uid` bigint,IN `in_sid` bigint,IN `in_type` int(5),IN in_code VARCHAR(10),IN in_sign VARCHAR(32),IN in_millis BIGINT,OUT `out_error` INT(10),OUT `out_msg` varchar(32))
_pb:BEGIN



	DECLARE STR_ERROR VARCHAR(30) DEFAULT '未知错误';

	DECLARE tmpResult BIGINT DEFAULT 0;

	DECLARE tmpCode VARCHAR(10) DEFAULT NULL;



	DECLARE _error INT DEFAULT 0;

  DECLARE EXIT HANDLER FOR SQLEXCEPTION SET _error = 1;



	IF in_sid < 1 OR ISNULL(in_sign) OR LENGTH(in_sign) != 32 THEN

		SET out_error = 1001;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SELECT sCode,TIMESTAMPDIFF(SECOND,sentTime,NOW()) INTO tmpCode,tmpResult FROM t_sms_log WHERE flag=0 AND stype=in_type AND uid=in_uid AND id=in_sid AND sign0 LIKE in_sign;

	IF ISNULL(tmpCode) OR LENGTH(tmpCode) != 6 THEN

		SET out_error = 1000;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	ELSEIF tmpResult * 1000 > in_millis THEN

		SET out_error = 1110;

		SET out_msg = '验证码已过期，请重新获取';

		LEAVE _pb;

	ELSEIF tmpCode != in_code THEN

		SET out_error = 1111;

		SET out_msg = '验证码错误';

		LEAVE _pb;

	END IF;



	UPDATE t_sms_log SET flag=1 WHERE id=in_sid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF ISNULL(tmpResult) OR tmpResult != 1 THEN

		SET out_error = 1112;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	IF _error <> 0 THEN

		SET out_error = 70;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	ELSE

		SET out_error = -1;

		SET out_msg = '';

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_sms_sent` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_sms_sent` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_sms_sent`(IN `in_uid` bigint,IN `in_type` int(5),IN `in_cell` varchar(13),IN in_sign VARCHAR(32),IN in_max INT(5),IN in_millis BIGINT,IN in_ip VARCHAR(20),OUT `out_error` INT(10),OUT `out_msg` varchar(32))
_pb:BEGIN



	DECLARE STR_ERROR VARCHAR(30) DEFAULT '未知错误';

	DECLARE tmpResult, tmpSid BIGINT DEFAULT 0;

	DECLARE tmpCode VARCHAR(10) DEFAULT NULL;

	DECLARE tmpStr VARCHAR(100) DEFAULT NULL;



	DECLARE _error INT DEFAULT 0;

  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	IF in_type = 1 THEN # 洗车人注册

		SET tmpResult = -1;

		SELECT COUNT(*) INTO tmpResult FROM t_user WHERE flag>-1 AND userType=2 AND cellphone LIKE in_cell;

		IF tmpResult != 0 THEN

			SET out_error = 1200;

			SET out_msg = '该手机号已经被使用';

			LEAVE _pb;

		END IF;

	ELSEIF in_type = 2 THEN # 找回登录密码

		SELECT id INTO in_uid FROM t_user WHERE flag>-1 AND cellphone LIKE in_cell;

		IF in_uid < 1 THEN

			SET out_error = 1200;

			SET out_msg = '手机号码错误';

			LEAVE _pb;

		END IF;



		SELECT COUNT(*) INTO tmpResult FROM t_sms_log WHERE flag=1 AND stype=2 AND sentTime>CURDATE() AND (uid=in_uid OR cellphone LIKE in_cell);

		IF tmpResult > 0 THEN

			SET out_error = 1002;

			SET out_msg = CONVERT(CONCAT('一天只能',IF(in_type=2,'找回登录密码','修改手机号'),'一次'),CHAR);

			LEAVE _pb;

		END IF;

	ELSEIF in_type = 3 OR in_type = 5 THEN # 绑定手机号 / 修改手机号

		IF in_uid < 1 OR ISNULL(in_cell) OR LENGTH(in_cell) != 11 THEN

			SET out_error = 1001;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;



		SET tmpResult = -1;

		SELECT COUNT(*) INTO tmpResult FROM t_user WHERE flag>-1 AND userType=1 AND cellphone LIKE in_cell;

		IF tmpResult != 0 THEN

			SET out_error = 1102;

			SET out_msg = '该手机号已经被使用';

			LEAVE _pb;

		END IF;

	ELSEIF in_type = 6 THEN #

		SET in_uid = -1;

		SET tmpResult = -1;

		SELECT COUNT(*),id,openid INTO tmpResult,in_uid,tmpStr FROM t_user WHERE flag>-1 AND userType=3 AND cellphone LIKE in_cell;

		IF tmpResult != 1 OR in_uid < 1 THEN # 不是代理

			SET out_error = 1300;

			SET out_msg = '该手机号暂未开通代理权限';

			LEAVE _pb;

		ELSEIF !ISNULL(tmpStr) AND LENGTH(tmpStr) > 0 THEN # 已经绑定过

			SET out_error = 1301;

			SET out_msg = '未知错误，请刷新页面';

			LEAVE _pb;

		END IF;

	ELSE

		SET out_error = 1101;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	SELECT id INTO tmpResult FROM t_sms_type WHERE flag=0 AND val=in_type;

	IF tmpResult < 1 THEN

		SET out_error = 1000;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	# 发送总次数统计

	SET tmpResult = 0;

	SELECT COUNT(DISTINCT id) INTO tmpResult FROM t_sms_log WHERE sentTime>CURDATE() AND ((uid>0 AND uid=in_uid) OR cellphone LIKE in_cell);

	IF tmpResult >= in_max THEN

		SET out_error = 1003;

		SET out_msg = '今日短信次数已用完，请明日再试';

		LEAVE _pb;

	END IF;



	SELECT sCode INTO tmpCode FROM t_sms_log WHERE flag=0 AND uid=in_uid AND stype=in_type AND TIMESTAMPDIFF(SECOND,sentTime,NOW()) * 1000 < in_millis ORDER BY id DESC LIMIT 1;

	IF ISNULL(tmpCode) OR LENGTH(tmpCode) != 32 THEN

		SET tmpCode = RIGHT(CONCAT('000000',FLOOR(RAND() * 1000000)),6);

	END IF;



	INSERT INTO t_sms_log(uid,stype,cellphone,sCode,sentTime,ip,sign0) VALUE(in_uid,in_type,in_cell,tmpCode,NOW(),in_ip,in_sign);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF ISNULL(tmpResult) OR tmpResult < 1 THEN

		SET out_error = 1004;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	IF _error <> 0 THEN

		SET out_error = 70;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	ELSE

		SET out_error = -1 * tmpResult;

		SET out_msg = CONCAT(tmpCode, ',', in_uid);

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_statistics_operating_agent` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_statistics_operating_agent` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_statistics_operating_agent`(IN `in_uid` bigint,IN in_uType INT(5),OUT `out_result` int(10))
_pb:BEGIN



	DECLARE _error INT DEFAULT 0;



	DECLARE tmpFundUsable DECIMAL(18,2) DEFAULT 0;

	DECLARE tmpScore, tmpResult BIGINT DEFAULT 0;

	DECLARE tmpAllSum, tmpWasherSum, tmpAgentSum, tmpAllSum0, tmpWasherSum0, tmpAgentSum0, tmpAllSum7, tmpWasherSum7, tmpAgentSum7, tmpAllSum30, tmpWasherSum30, tmpAgentSum30 DECIMAL(18,2) DEFAULT 0;

	DECLARE tmpOrderCounts, tmpInvalidOrderCounts, tmpOrderCounts0, tmpInvalidOrderCounts0, tmpOrderCounts7, tmpInvalidOrderCounts7, tmpOrderCounts30, tmpInvalidOrderCounts30 INT DEFAULT 0;

	DECLARE tmpCurrDate date DEFAULT CURDATE();

	DECLARE tmpDate date DEFAULT NULL;

	DECLARE tmpDateMin date DEFAULT DATE_SUB(tmpCurrDate, INTERVAL 30 DAY);



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	SET tmpResult = 0;

	SELECT COUNT(*),fundUsable,score INTO tmpResult, tmpFundUsable, tmpScore FROM t_user WHERE userType=in_uType AND id=in_uid;

	IF tmpResult != 1 THEN

		SET out_result = 1000;

		LEAVE _pb;

	END IF;



	START TRANSACTION;



	# 清除已有数据

	DELETE FROM t_tmp_statistics_operating_agent WHERE tag=in_uid;



	SET tmpResult = 0;

	INSERT INTO t_tmp_statistics_operating_agent(tag,orderId,uid,fType,amount,recordTime)

		SELECT in_uid,f.orderId,u.id,f.ftype,f.handlesum,f.recordtime FROM t_fund_record f LEFT JOIN t_user u ON f.uid=u.id WHERE f.ftype IN (44,63) AND recordtime>tmpDateMin AND (u.id=in_uid OR u.referee=in_uid);

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult = 0 THEN

		SET out_result = -1;

		SELECT CONVERT(tmpFundUsable,CHAR) AS fundUsable, tmpScore AS score,

			CONVERT(tmpAllSum,CHAR) AS allSum, CONVERT(tmpWasherSum,CHAR) AS washerSum, CONVERT(tmpAgentSum,CHAR) AS agentSum, tmpOrderCounts AS orderCounts, tmpInvalidOrderCounts AS invalidOrderCounts,

			CONVERT(tmpAllSum0,CHAR) AS allSum0, CONVERT(tmpWasherSum0,CHAR) AS washerSum0, CONVERT(tmpAgentSum0,CHAR) AS agentSum0, tmpOrderCounts0 AS orderCounts0, tmpInvalidOrderCounts0 AS invalidOrderCounts0,

			CONVERT(tmpAllSum7,CHAR) AS allSum7, CONVERT(tmpWasherSum7,CHAR) AS washerSum7, CONVERT(tmpAgentSum7,CHAR) AS agentSum7, tmpOrderCounts7 AS orderCounts7, tmpInvalidOrderCounts7 AS invalidOrderCounts7,

			CONVERT(tmpAllSum30,CHAR) AS allSum30, CONVERT(tmpWasherSum30,CHAR) AS washerSum30, CONVERT(tmpAgentSum30,CHAR) AS agentSum30, tmpOrderCounts30 AS orderCounts30, tmpInvalidOrderCounts30 AS invalidOrderCounts30;

		LEAVE _pb;

	END IF;



	# 今日数据

	SELECT COUNT(DISTINCT orderId),SUM(IF(uid=in_uid,0,amount)),SUM(IF(uid=in_uid,amount,0)) INTO tmpOrderCounts,tmpWasherSum,tmpAgentSum FROM t_tmp_statistics_operating_agent WHERE recordTime>tmpCurrDate;

	IF ISNULL(tmpWasherSum) THEN

		SET tmpWasherSum = 0;

	END IF;

	IF ISNULL(tmpAgentSum) THEN

		SET tmpAgentSum = 0;

	END IF;

	SET tmpAllSum = tmpWasherSum + tmpAgentSum;

	SELECT COUNT(*) INTO tmpInvalidOrderCounts FROM t_order o LEFT JOIN t_user u ON o.wid=u.id WHERE o.flag IN (8,20) AND o.finishTime>tmpCurrDate;



	# 昨日数据

	SET tmpDate = DATE_SUB(tmpCurrDate, INTERVAL 1 DAY);

	SELECT COUNT(DISTINCT orderId),SUM(IF(uid=in_uid,0,amount)),SUM(IF(uid=in_uid,amount,0)) INTO tmpOrderCounts0,tmpWasherSum0,tmpAgentSum0 FROM t_tmp_statistics_operating_agent WHERE recordTime BETWEEN tmpDate AND tmpCurrDate;

	IF ISNULL(tmpWasherSum0) THEN

		SET tmpWasherSum0 = 0;

	END IF;

	IF ISNULL(tmpAgentSum0) THEN

		SET tmpAgentSum0 = 0;

	END IF;

	SET tmpAllSum0 = tmpWasherSum0 + tmpAgentSum0;

	SELECT COUNT(*) INTO tmpInvalidOrderCounts0 FROM t_order o LEFT JOIN t_user u ON o.wid=u.id WHERE o.flag IN (8,20) AND o.finishTime BETWEEN tmpDate AND tmpCurrDate;



	# 七日数据

	SET tmpDate = DATE_SUB(tmpCurrDate, INTERVAL 7 DAY);

	SELECT COUNT(DISTINCT orderId),SUM(IF(uid=in_uid,0,amount)),SUM(IF(uid=in_uid,amount,0)) INTO tmpOrderCounts7,tmpWasherSum7,tmpAgentSum7 FROM t_tmp_statistics_operating_agent WHERE recordTime > tmpDate;

	IF ISNULL(tmpWasherSum7) THEN

		SET tmpWasherSum7 = 0;

	END IF;

	IF ISNULL(tmpAgentSum7) THEN

		SET tmpAgentSum7 = 0;

	END IF;

	SET tmpAllSum7 = tmpWasherSum7 + tmpAgentSum7;

	SELECT COUNT(*) INTO tmpInvalidOrderCounts7 FROM t_order o LEFT JOIN t_user u ON o.wid=u.id WHERE o.flag IN (8,20) AND o.finishTime > tmpDate;



	# 30日数据

	SELECT COUNT(DISTINCT orderId),SUM(IF(uid=in_uid,0,amount)),SUM(IF(uid=in_uid,amount,0)) INTO tmpOrderCounts30,tmpWasherSum30,tmpAgentSum30 FROM t_tmp_statistics_operating_agent WHERE recordTime > tmpDateMin;

	IF ISNULL(tmpWasherSum30) THEN

		SET tmpWasherSum30 = 0;

	END IF;

	IF ISNULL(tmpAgentSum30) THEN

		SET tmpAgentSum30 = 0;

	END IF;

	SET tmpAllSum30 = tmpWasherSum30 + tmpAgentSum30;

	SELECT COUNT(*) INTO tmpInvalidOrderCounts30 FROM t_order o LEFT JOIN t_user u ON o.wid=u.id WHERE o.flag IN (8,20) AND o.finishTime > tmpDateMin;



	# 清除临时数据

	DELETE FROM t_tmp_statistics_operating_agent WHERE tag=in_uid;



	IF _error <> 0 THEN

		ROLLBACK;

		SET out_result = 90;

		LEAVE _pb;

	ELSE

		COMMIT;

		SET out_result = -1;

		SELECT CONVERT(tmpFundUsable,CHAR) AS fundUsable, tmpScore AS score,

			CONVERT(tmpAllSum,CHAR) AS allSum, CONVERT(tmpWasherSum,CHAR) AS washerSum, CONVERT(tmpAgentSum,CHAR) AS agentSum, tmpOrderCounts AS orderCounts, tmpInvalidOrderCounts AS invalidOrderCounts,

			CONVERT(tmpAllSum0,CHAR) AS allSum0, CONVERT(tmpWasherSum0,CHAR) AS washerSum0, CONVERT(tmpAgentSum0,CHAR) AS agentSum0, tmpOrderCounts0 AS orderCounts0, tmpInvalidOrderCounts0 AS invalidOrderCounts0,

			CONVERT(tmpAllSum7,CHAR) AS allSum7, CONVERT(tmpWasherSum7,CHAR) AS washerSum7, CONVERT(tmpAgentSum7,CHAR) AS agentSum7, tmpOrderCounts7 AS orderCounts7, tmpInvalidOrderCounts7 AS invalidOrderCounts7,

			CONVERT(tmpAllSum30,CHAR) AS allSum30, CONVERT(tmpWasherSum30,CHAR) AS washerSum30, CONVERT(tmpAgentSum30,CHAR) AS agentSum30, tmpOrderCounts30 AS orderCounts30, tmpInvalidOrderCounts30 AS invalidOrderCounts30;

		LEAVE _pb;

	END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `p_washer_add` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_washer_add` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_washer_add`(IN in_cellphone VARCHAR(13),IN in_referee BIGINT,IN in_refereeCode VARCHAR(11),IN in_openID VARCHAR(100), IN in_nickname VARCHAR(50), IN in_icon VARCHAR(255),IN in_leftCounts INT,IN in_oCode INT,IN in_remarks VARCHAR(1024),IN in_ip VARCHAR(25), IN in_sign0 VARCHAR(32), IN in_sign1 VARCHAR(32), OUT `out_result` int(10),OUT out_msg VARCHAR(1024))
_pb:BEGIN



	DECLARE _error INT DEFAULT 0;



	DECLARE tmpUType INT DEFAULT 2;

	DECLARE tmpResult, tmpUid BIGINT DEFAULT 0;

	DECLARE tmpCurTime datetime DEFAULT NOW();

	DECLARE STR_ERROR VARCHAR(30) DEFAULT '未知错误';

	DECLARE tmpStr VARCHAR(10) DEFAULT NULL;



	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _error = 1;



	IF in_referee > 0 THEN

		SET tmpResult = -1;

		SELECT COUNT(*) INTO tmpResult FROM t_user WHERE flag>-1 AND userType=3 AND id=in_referee;

		IF tmpResult != 1 THEN

			SET out_result = 1000;

			SET out_msg = STR_ERROR;

			LEAVE _pb;

		END IF;

	ELSE

		SET tmpResult = -1;

		SELECT COUNT(*),id INTO tmpResult,in_referee FROM t_user WHERE flag>-1 AND userType=3 AND refereeCode LIKE in_refereeCode;

		IF tmpResult != 1 OR in_referee < 1 THEN

			SET out_result = 1001;

			SET out_msg = '该推荐码无效';

			LEAVE _pb;

		END IF;

	END IF;



	SET tmpResult = -1;

	SELECT COUNT(*) INTO tmpResult FROM t_user WHERE flag>-1 AND userType=2 AND cellphone LIKE in_cellphone;

	IF tmpResult != 0 THEN

		SET out_result = 1002;

		SET out_msg = '该手机号已被使用';

		LEAVE _pb;

	END IF;



	INSERT INTO t_user(userType,cellphone,referee,openid,createTime,sign0,sign1) VALUE(tmpUType, in_cellphone, in_referee, in_openID, tmpCurTime, in_sign0, in_sign1);

	SELECT LAST_INSERT_ID() INTO tmpUid;

	IF tmpUid < 1 THEN

		SET out_result = 1100;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	UPDATE t_user SET refereeCode=f_format_referee_code(id) WHERE id=tmpUid;

	SELECT ROW_COUNT() INTO tmpResult;

	IF tmpResult != 1 THEN

		SET out_result = 1101;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	INSERT INTO t_person(icon,nickname,leftCounts,uid) VALUE(in_icon, in_nickname, in_leftCounts, tmpUid);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_result = 1102;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	SET tmpResult = 0;

	INSERT INTO t_operation_log(uid,utype,ocode,recordTime,remarks,uip) VALUE(tmpUid, tmpUType, in_oCode, tmpCurTime, in_remarks, in_ip);

	SELECT LAST_INSERT_ID() INTO tmpResult;

	IF tmpResult < 1 THEN

		SET out_result = 1202;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	END IF;



	IF _error <> 0 THEN

		SET out_result = 90;

		SET out_msg = STR_ERROR;

		LEAVE _pb;

	ELSE

		SET out_result = -tmpUid;

		SET out_msg = '注册成功';

		LEAVE _pb;

